import React from 'react';
import '../css/Cart.css'

function Cart(){
    return (
        <div className='cart'>
            <h4>Your Cart</h4>
        <div className='row'>
            <img src="https://images.bewakoof.com/uploads/grid/app/types-of-shirts-for-men-bewakoof-blog-1-1610963787.jpg" className="brand" alt="img" />
        </div>
        <div className='row'>
        <img src="data:image/jpeg;base64," className="brand" alt="img" />
        </div>
        </div>
    );
}

export default Cart;
